script: |
  super -f text -I q13654.spq | sort > q13654.out

inputs:
  - name: q13654.spq
    data: |
      SELECT DISTINCT col2 AS col1 FROM tab2 (FORMAT parquet) WHERE + CAST ( NULL AS INTEGER ) + - - 1 * - 65 + - 5 BETWEEN col1 AND - col1 + - col2 * - col1 * + col1 - - col2;
  - name: tab2

outputs:
  - name: q13654.out
    data: |
